import React from 'react';
import '../vibecheck.css';
import { Redirect } from "react-router-dom";
import Select from 'react-select';
import makeAnimated from 'react-select/animated';
import './loginsignup.css';
import axios from 'axios';
import Accordion from 'react-bootstrap/Accordion'
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";

const genres = []
const animatedComponents = makeAnimated();
class AxiosExample extends React.Component {

  //the states of emotion and source will be set to null initially until the user had filled out the form.
  constructor() {
    super();
    this.state = {
      example: null,
      exampleArray: []
    };
  }

  componentDidMount() {

    //creates a k,v pair list for genres that will be fed into react-select
    axios.get(`http://localhost:5000/example`)
      .then((response) => {
        //alert(response.data.data)

        this.setState({
          example: response.data.data
        });

      }).catch((error) => {
        alert("There was an error connecting to the api")
        console.error(error);
      });

    //secong get request
    axios.get(`http://localhost:5000/exampleArray`)
      .then((response) => {
        //alert(response.data.data)
        //we have to set a temp array and then set that equal to that state
        //this is beacause state arrays have no simple push feature, only setState
        var mack = []

        for (var i = 0; i < response.data.data.length; i++) {
          mack.push(response.data.data[i])
        }

        this.setState({
          exampleArray: mack,

        });

      }).catch((error) => {
        //alert("There was an error connecting to the api")
        console.error(error);
      });
  }

  render() {

    return (
      <div >
        <br></br>
        <div class="btn-group">

          <a href="http://localhost:3000/playlist" class="btn btn-primary btn-lg" role="button">Create New Playlist</a>
          <a href="http://localhost:3000/" class="btn btn-primary btn-lg" role="button">Log Out</a>

        </div>
        <br></br>

        {/*In React, map is the equivalent of a loop for html. it requires (key, value) assignments*/}
        <br></br>

        {this.state.exampleArray.map((item, key) =>
        <div class="row accordion-gradient-bcg d-flex justify-content-center">

          <div class="col-md-10 col-xl-6 py-5">

            <div class="accordion md-accordion accordion-2" id="accordionEx7" role="tablist"
              aria-multiselectable="true">

              <div class="card">

                <div class="card-header rgba-stylish-strong z-depth-1 mb-1" role="tab" id="heading1">
                  <a data-toggle="collapse" data-parent="#accordionEx7" href="#collapse1" aria-expanded="true"
                    aria-controls="collapse1">
                    <h5 class="mb-0 white-text text-uppercase font-thin">
                      #1 <i class="fas fa-angle-down rotate-icon"></i>
                    </h5>
                  </a>
                </div>

                <div id="collapse1" class="collapse show" role="tabpanel" aria-labelledby="heading1"
                  data-parent="#accordionEx7">
                  <div class="card-body mb-1 rgba-grey-light white-text">
                    <p>Anim pariatur cliche reprehenderit, enim eiusmod high life accusamus terry richardson ad squid.
                      3 wolf moon officia aute,
                      non cupidatat skateboard dolor brunch. Food truck quinoa nesciunt laborum eiusmod. Brunch
                      3 wolf moon tempor, sunt aliqua put a bird on it squid single-origin coffee nulla assumenda
                      shoreditch et. Nihil anim keffiyeh helvetica, craft beer labore wes anderson cred nesciunt
                      sapiente ea proident. Ad vegan excepteur butcher vice lomo. Leggings occaecat craft beer
                      farm-to-table, raw denim aesthetic synth nesciunt you probably haven't heard of them
                      accusamus labore sustainable.</p>
                  </div>
                </div>
              </div>

            </div>

          </div>

        </div>
        )}



      </div>

    )

  }
}
export default AxiosExample;
